import React from 'react';

function Header(){
    const client = "Designer";
    const title = {
        designer: "Design ",
        programmer: "Programming "
    }

    const info = {
        name: "Maha",
        last: "Alsuhaymi"
    }

    return(
        <div className="navbar bg-dark rounded">
        <h2 className="text-white">
            {client == "Designer" ? title.designer : title.programmer} 
            is my life
            </h2>
        </div>
    );
}

export default Header;
